import React, { Component, Fragment } from 'react';
import TodoItem from './TodoItem';
import { Link } from "react-router-dom";
import './style.css';
import './css/bootstrap.min.css';
import './css/style.css';
import './css/responsive.css';
import './css/orange.css';
import client1 from './images/client-1.jpg';
import client2 from './images/client-2.jpg';
import client3 from './images/client-3.jpg';
import Registration from './Registration';

class Home extends Component {

	constructor(props) {
		super(props);
		}

render() {
	return(

      <div>
        <title>Travel Agency</title>
        <meta charSet="utf-8" />
        <meta name="viewport" content="width=device-width,initial-scale=1" />
        <link rel="icon" href="images/favicon.png" type="image/x-icon" />
        {/* Google Fonts */}  
        <link href="https://fonts.googleapis.com/css?family=Lato:300,300i,400,400i,700,700i,900,900i%7CMerriweather:300,300i,400,400i,700,700i,900,900i" rel="stylesheet" />
        {/* Bootstrap Stylesheet */}  
        <link rel="stylesheet" href="css/bootstrap.min.css" />
        {/* Font Awesome Stylesheet */}
        <link rel="stylesheet" href="css/font-awesome.min.css" />
        {/* Custom Stylesheets */}  
        <link rel="stylesheet" href="css/style.css" />
        <link rel="stylesheet" id="cpswitch" href="css/orange.css" />
        <link rel="stylesheet" href="css/responsive.css" />
        {/* Owl Carousel Stylesheet */}
        <link rel="stylesheet" href="css/owl.carousel.css" />
        <link rel="stylesheet" href="css/owl.theme.css" />
        {/* Flex Slider Stylesheet */}
        <link rel="stylesheet" href="css/flexslider.css" type="text/css" />
        {/*Date-Picker Stylesheet*/}
        <link rel="stylesheet" href="css/datepicker.css" />


        {/*============= TOP-BAR ===========*/}
        <div id="top-bar" className="tb-text-white">
          <div className="container">
            <div className="row">          
              <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
                <div id="info">
                  <ul className="list-unstyled list-inline">
                    <li><span><i className="fa fa-map-marker" /></span></li>
                    <li><span><i className="fa fa-phone" /></span></li>
                  </ul>
                </div>{/* end info */}
              </div>{/* end columns */}
              <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
                <div id="links">
                  <ul className="list-unstyled list-inline">
                    <li><Link to="/login"><span><i className="fa fa-lock" /></span>Login</Link></li>
                    <li><Link to="/registration"><span><i className="fa fa-plus" /></span>Sign Up</Link></li>
                  </ul>
                </div>{/* end links */}
              </div>{/* end columns */}       
            </div>{/* end row */}
          </div>{/* end container */}
        </div>{/* end top-bar */}
        {/*========================= FLEX SLIDER =====================*/}
        <section className="flexslider-container" id="flexslider-container-6">
          <div className="header-absolute">
            <nav className="navbar navbar-default main-navbar navbar-custom navbar-transparent landing-page-navbar" id="mynavbar">
              <div className="container">
                <div className="navbar-header">
                  <button type="button" className="navbar-toggle" id="menu-button">
                    <span className="icon-bar" />
                    <span className="icon-bar" />
                    <span className="icon-bar" />                        
                  </button>
                  <div className="header-search hidden-lg">
                    <a href="javascript:void(0)" className="search-button"><span><i className="fa fa-search" /></span></a>
                  </div>
                  <a href="#" className="navbar-brand"><span><i className="fa fa-plane" />STAR</span>TRAVELS</a>
                </div>{/* end navbar-header */}
                <div className="collapse navbar-collapse" id="myNavbar1">
                  <ul className="nav navbar-nav navbar-right">
                    <li><a href="#tour-homepage">Home</a></li>
